'use client'

import React, { useCallback, useContext, useEffect, useState } from 'react'
import Image from 'next/image'
import { useRouter } from 'next/router'
import { ShoppingCart } from 'lucide-react'

import { Button } from "@/components/ui/button"
import { Card } from "@/components/ui/card"
import {
  Select,
  SelectContent,
  SelectItem,
  SelectTrigger,
  SelectValue,
} from "@/components/ui/select"

import ApiService from '@/services/ApiService'
import AuthContext from '@/store/auth-context'
import Loading from '@/components/basic/Loading'
import ProductForm from '@/components/productForm/ProductForm'

const AvailableProducts = () => {
  const ctx = useContext(AuthContext)
  const router = useRouter()

  const [products, setProducts] = useState([])
  const [query, setQuery] = useState({
    genre_major: '',
    genre_minor: '',
    genre: '',
    brand: '',
    category: '',
  })
  const [isLoading, setIsLoading] = useState(false)
  const [error, setError] = useState(null)

  const fetchProductsHandler = useCallback(async (queryObj) => {
    setIsLoading(true)
    setError(null)
    try {
      let response
      if (Object.values(queryObj).some((x) => x !== '')) {
        setQuery(queryObj)
        const queryArray = Object.entries(queryObj)
          .filter(([key, value]) => value !== '' && ['genre', 'brand', 'category'].includes(key))
          .map(([key, value]) => `${key}=${value}`)
        const queryString = queryArray.join('&')
        response = await ApiService.fetchProductsByQueryString(queryString)
      } else {
        response = await ApiService.fetchProducts()
      }
      if (!response.ok) {
        throw new Error('상품을 불러오는데 실패했습니다.')
      }
      const data = await response.json()
      setProducts(data.content || [])
    } catch (err) {
      setError(err.message || '상품을 불러오는데 실패했습니다.')
    } finally {
      setIsLoading(false)
    }
  }, [])

  useEffect(() => {
    fetchProductsHandler(query)
    ctx.setCurrentPage('products')
  }, [fetchProductsHandler, ctx, query])

  const handleProductClick = (productNum) => {
    router.push(`/product/${productNum}`)
  }

  if (isLoading) {
    return (
      <Card className="p-4">
        <Loading />
      </Card>
    )
  }

  if (error) {
    return (
      <Card className="p-4">
        <p className="text-red-500">{error}</p>
      </Card>
    )
  }

  if (products.length === 0) {
    return (
      <Card className="p-4">
        <h2 className="text-xl font-semibold">현재 상품 목록이 비어있습니다.</h2>
      </Card>
    )
  }

  return (
    <Card className="p-4">
      <ProductForm queryObj={query} fetchProducts={fetchProductsHandler} renderItems={renderItems} />
      <ul className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
        {products.map((product) => (
          <li key={product.productCode} className="border rounded-lg overflow-hidden shadow-sm">
            <div className="cursor-pointer" onClick={() => handleProductClick(product.productNum)}>
              <div className="relative h-48">
                <Image
                  src={product.productImg[0]}
                  alt={product.productName}
                  layout="fill"
                  objectFit="cover"
                />
              </div>
              <div className="p-4">
                <h3 className="font-semibold text-lg mb-2">{product.productName}</h3>
                <div className="flex justify-between items-center">
                  <div>
                    {product.rprice > 0 && product.rprice < product.oprice ? (
                      <>
                        <p className="text-sm line-through text-gray-500">{product.oprice.toLocaleString()}원</p>
                        <p className="text-lg font-bold text-red-600">{product.rprice.toLocaleString()}원</p>
                      </>
                    ) : (
                      <p className="text-lg font-bold">{product.oprice.toLocaleString()}원</p>
                    )}
                  </div>
                  <Button size="sm" variant="outline">
                    <ShoppingCart className="w-4 h-4 mr-2" />
                    장바구니
                  </Button>
                </div>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </Card>
  )
}

const renderItems = [
  {
    id: 'genre',
    items: [
      {
        id: 'genre_major',
        name: '장르 대분류 선택',
        list: [
          { value: '001', label: '상의' },
          { value: '002', label: '아우터' },
          { value: '003', label: '바지' },
          { value: '004', label: '원피스' },
          { value: '005', label: '스커트' },
          { value: '006', label: '스니커즈' },
          { value: '007', label: '신발' },
          { value: '008', label: '모자' },
          { value: '009', label: '양말 및 레그워머' },
        ],
      },
      {
        id: 'genre_minor',
        name: '장르 소분류 선택',
        list_obj: {
